features.script:
setInterval(() => {
        let p = parcel.getPlayers()[0];

        var arr1 = ['backflip', 'Dance', 'Wave', 'Spin', 'Savage', 'Uprock', 'Floss', 'backflip'];

        var index1 = Math.floor((Math.random()*arr1.length));

        p.animate(arr1[index1]);
        p.emote("");

}, 100)
